INSERT INTO "public"."cms_tree" VALUES ('77', '1', '1', '1457010249', '1465302250', 'Доставка и оплата', null, null, '', '<p style="line-height: 20.8px;"><strong><span style="font-size: 16px;"><u>Доставка</u></span></strong></p>

<p style="line-height: 20.8px;"><u><strong>Курьерская доставка по Москве</strong></u></p>

<p style="line-height: 20.8px;">Курьерская служба&nbsp;<strong>jhanway</strong>&nbsp;аккуратно доставит Ваш заказ в пределах МКАД на следующий день после заказа. Теперь у Вас есть возможность оплатить заказ после примерки.&nbsp;</p>

<p style="line-height: 20.8px;">&nbsp; &nbsp;<img alt="" src="/uploads/all/b5/17/e4/b517e480cf8bc89086b4d40198c6f8df.gif" style="width: 450px; height: 536px;" /></p>

<p style="line-height: 20.8px;"><strong>Стоимость доставки в пределах МКАД:</strong></p>

<ul style="line-height: 20.8px;">
	<li>При единовременном заказе от 3000&nbsp;рублей - включена в стоимость заказа*&nbsp;</li>
	<li>При заказе до 3000&nbsp;рублей - 280 рублей</li>
	<li>Выезд курьера за пределы МКАД уточняйте у оператора</li>
</ul>

<p style="line-height: 20.8px;"><span style="font-size: 10px; line-height: 16px;">*Если одежда Вам&nbsp;не подошла&nbsp;оплачивается услуга курьерской доставки.</span></p>

<hr />
<p style="line-height: 20.8px;">&nbsp;</p>

<p style="line-height: 20.8px;"><u><strong>Экспресс доставка по России</strong></u></p>

<p style="line-height: 20.8px;">Интернет магазин jhanway&nbsp;имеет возможность доставки вашего заказа в любой регион Российской Федерации. Мы работаем с надежными службами доставки <span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">&nbsp;</span><a href="http://emspost.ru/ru/" style="color: rgb(56, 176, 227); font-family: Arial, Helvetica, sans-serif; line-height: normal; font-size: 12px; cursor: pointer;">EMS RUSSIAN POST</a><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">,&nbsp;</span><a href="http://www.ponyexpress.ru/" style="color: rgb(56, 176, 227); font-family: Arial, Helvetica, sans-serif; line-height: normal; font-size: 12px; cursor: pointer;">PONY EXPRESS</a>. &nbsp;Сроки доставки зависят от удаленности от Москвы (средний срок получения от 2 до 7 рабочих дней)&nbsp;<img alt="" src="/uploads/all/79/68/1b/79681b30c9fdf88770962e5020c5e7c7.png" style="width: 842px; height: 453px;" /></p>

<p style="line-height: 20.8px;"><strong>Стоимость доставки в пределах РФ:</strong></p>

<ul style="line-height: 20.8px;">
	<li><span style="line-height: 20.8px;">При единовременном заказе от 5990&nbsp;рублей - включена в стоимость заказа</span></li>
	<li><span style="line-height: 20.8px;">При заказе до 5990 рублей - 300-700 рублей&nbsp;</span><span style="line-height: 20.8px;">&nbsp;&nbsp;</span></li>
</ul>

<p><span style="line-height: 20.8px;">За подробной информацией о сроках&nbsp;получения и&nbsp;расчете стоимости&nbsp;перейдите на сайт.</span></p>

<hr />
<p>&nbsp;</p>

<p style="line-height: 20.8px;"><strong><span style="font-size: 16px;"><u><span style="line-height: 20.8px;">Оплата</span></u></span></strong></p>

<p style="line-height: 20.8px;">В пределах Москвы производится курьеру.&nbsp;</p>

<p style="line-height: 20.8px;">Оформите&nbsp;экспресс доставку&nbsp;по России,&nbsp;оплата&nbsp;при&nbsp;получении в пункте выдачи.&nbsp;</p>

<p style="line-height: 20.8px;"><strong><u>Способы оплаты:&nbsp;</u></strong></p>

<p style="line-height: 20.8px;"><strong><u><img alt="" src="/uploads/all/09/21/16/0921164132bc2c153b9b1af9edf86b9a.jpg" style="margin-left: 25px; margin-right: 25px; width: 400px; height: 299px;" /></u></strong></p>

<ul style="line-height: 20.8px;">
	<li>Внимание! &nbsp;при оплате банковской картой&nbsp;просим заранее уведомить оператора при оформлении заказа.&nbsp;</li>
</ul>

